@Override
protected LightAutomaton convertAutomaton(LightAutomaton a) {
  if (unicodeAware) {
    LightAutomaton utf8automaton = new UTF32ToUTF8Light().convert(a);
    utf8automaton = BasicOperations.determinize(utf8automaton);
    return utf8automaton;
  } else {
    return a;
  }
}

